#include "libft_test.h"

static void test_ft_memcpy_one(void *src0, size_t len, int *current, int total) {
	
	*current += 1;
	unsigned char *dst;
	unsigned char *src = src0;
	dst = (unsigned char *)malloc(len);
	ft_memcpy(dst, src, len);
	for (size_t i = 0; i<len; i++) {
		if (src[i] != dst[i]) {
			printf("FT_MEMCPY failed at [%d][%zu]: %u != %u\n", *current, i, dst[i], src[i]);
			fflush(stdout);
		}
		assert(src[i] == dst[i]);
	}
	free(dst);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_memcpy_speed()
{
	char	*src;
	char	*dst;

	CATEGORY("ft_memcpy performance");

	size_t len = 1048576;
	size_t iter = 1000;

	clock_t start = 0;
	src = (char *)malloc(sizeof(char) * len);
	dst = (char *)malloc(sizeof(char) * len);
	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memcpy(dst, src, len);
	}
	clock_t end = clock();
	double ft_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / ft_time, "memcpy");

	ft_bzero(dst, len);
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		ft_memcpy(dst, src, len);
	}
	end = clock();
	double new_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / new_time, "ft_memcpy");
	SPEEDCMP((ft_time / new_time) * 100, "memcpy");
	free(src);
	free(dst);
}
#endif // SPEEDTEST

